    public static void m2(StringBuilder sb ,int colNum, int rowNum ){
        int[][] arr = new int[colNum][rowNum];

        int maxColNum = 0;
        int maxRowNum = 0;

        StringBuilder x = new StringBuilder();
        StringBuilder y = new StringBuilder();
        StringBuilder v = new StringBuilder();
        char tmp;
        boolean num = false;
        for(int i=0;i<sb.length();i++){
            tmp = sb.charAt(i);
            if(tmp == 34 ){//"
                tmp = sb.charAt(++i);
                if( tmp == 120 || tmp == 121 || tmp == 118){
                    if(tmp == 120 ){ //"x

                        for( ;!(tmp == 45 ||tmp >= 48 && tmp <= 57) && i+1< sb.length();tmp =sb.charAt(++i));

                        for(;tmp == 45 ||tmp >= 48 && tmp <= 57  && i+1< sb.length();tmp =sb.charAt(++i)){
                            x.append(tmp);
                        }


                    }
                    if(tmp == 121){// "y
                        for( ;!(tmp == 45 ||tmp >= 48 && tmp <= 57) && i+1< sb.length();tmp =sb.charAt(++i));

                        for(;tmp == 45 ||tmp >= 48 && tmp <= 57  && i+1< sb.length();tmp =sb.charAt(++i)){
                            y.append(tmp);
                        }

                    }

                    if(tmp == 118 && (tmp=sb.charAt(++i))==97){ //"va
                        for( ;!(tmp == 45 ||tmp >= 48 && tmp <= 57) && i+1< sb.length();tmp =sb.charAt(++i));

                        for(;tmp == 45 ||tmp >= 48 && tmp <= 57  && i+1< sb.length();tmp =sb.charAt(++i)){
                            v.append(tmp);
                        }

                        //System.out.println("x:"+x+",y:"+y+",v:"+v);

                        if(Integer.valueOf(v.toString()) != 0){
                            arr[Integer.valueOf(x.toString())][Integer.valueOf(y.toString())]=Integer.valueOf(v.toString());
                        }

                        x.setLength(0);y.setLength(0);v.setLength(0);

                    }
                }else{
                    continue;
                }



            }else{
                continue;
            }
        }
    }


    public static void m1(StringBuilder sb ){
        long start = System.currentTimeMillis();

        char left =0 ;
        int leftIndex = 0;

        char co = 0;//120 121 118

        StringBuilder x = new StringBuilder();
        StringBuilder y = new StringBuilder();
        StringBuilder v = new StringBuilder();

        char tmp;
        for(int i=0;i<sb.length();i++){
            tmp = sb.charAt(i);
            if(tmp == 32)
                continue;

            if(tmp == 34 ){
                if(left == 0){ //左分号
                    left = 34;
                    leftIndex = i;
                }else{ //右分号  "x  "y "v
                    continue;
                }

            }else if(tmp == 120 || tmp == 121 || tmp == 118){ // x  y v
                if(tmp == 120 || tmp == 121){
                    if(left == 34 && (leftIndex+1 == i)  && co == 0  ){// "x "y
                        co = tmp;
                    }else{
                        left = 0;
                    }
                }else if(tmp == 118 ){// "v  "version "value
                    if(left== 34 && leftIndex+1 == i && sb.charAt(++i) == 97){ //"value

                        co = tmp;
                    }else{
                        left = 0;
                    }
                }

            }else if( tmp == 45 ||tmp >= 48 && tmp <= 57 ){ // - 1-9
                if(left == 34 && co == 120 ){//生成x坐标 "x
                    x.append(tmp);

                }
                if(left == 34 && co == 121){//生成y坐标 "y
                    y.append(tmp);
                }
                if(left == 34 && co == 118 && y.length()> 0){
                    v.append(tmp);
                }

            }else{ //}
                if(left == 34){ //"h  "ve "
                    if(co == 120 || co == 121 || co == 118){
                        if(co == 120 && x.length() > 0){
                            System.out.print("x:"+x);
                            left = 0;leftIndex = 0;co = 0;
                        }
                        if(co == 121 && y.length() > 0){
                            System.out.print(" y:"+y);
                            left = 0;leftIndex = 0;co = 0;
                        }
                        if(co == 118 && v.length() > 0){
                            System.out.println(" v:"+v);
                            left = 0;leftIndex = 0;
                            x.setLength(0);y.setLength(0);v.setLength(0);
                        }
                    }else{
                        left = 0;leftIndex = 0;
                        continue;
                    }

                }else{

                    left = 0;leftIndex = 0;
                }


                continue;

//                System.out.println("x:"+x.toString() +",y"+y.toString());

            }

        }

        long end = System.currentTimeMillis();
        System.out.println();
//        System.out.println("hs:"+(end-start));
    }
